import React from 'react'

function RenderingLists() {
    const bookList = [
        "To Kill A Mockingbird",
        "The Great Gstsby",
        "The Catcher In The Rye"
    ]
    return (
        <div>
            {bookList.map(book => {
                return <h2>{book}</h2>
            })}
        </div>
    )
}

export default RenderingLists
